<template>
  <v-container class="fill-height" max-width="900">
    <v-row>
      <v-col v-for="sound in sounds" :key="sound.id" :cols="mdAndUp ? 6 : 12">
        <AudioPlayer :sound="sound" />
      </v-col>
      <v-col v-if="sounds.length === 0" class="text-left" cols="12">
        <span v-text="$t('noSound')" />
      </v-col>
      <v-col class="text-center" cols="12">
        <v-btn :append-icon="mdiPlus" :text="$t('addSound')" @click="addSound()" />
      </v-col>
    </v-row>
  </v-container>

</template>

<script lang="ts" setup>
  import { mdiPlus } from '@mdi/js'
  import { liveQuery } from 'dexie'
  import { onUnmounted, ref } from 'vue'
  import { useDisplay } from 'vuetify/framework'
  import AudioPlayer from '@/components/AudioPlayer.vue'
  import { db, type Sound } from '@/store/db.ts'

  const sounds = ref<Sound[]>([])
  const { mdAndUp } = useDisplay()

  const subscription = liveQuery(() => db.sounds.orderBy('name').toArray())
    .subscribe(result => {
      sounds.value = result
    })

  async function addSound () {
    await db.sounds.add({
      name: Array.from({ length: 10 }).map(() => String.fromCodePoint(Math.floor((Math.random() * (90 - 65)) + 65))).join('-'),
      content: 'data:audio/ogg;base64,',
    })
  }

  onUnmounted(() => {
    subscription.unsubscribe()
  })
</script>
